sys_variable_value.value:
(function execute(inputs, outputs) {
    try {

        var gr = new GlideRecord('scheduled_import_set');
        gr.addQuery('sys_id', inputs.table_sys_id);
        gr.query();
        if (gr.next()) {
            gr.initialize();
            gr.active = inputs.active;
            gr.starting = inputs.starting;
            gr.update();
            outputs.msg = 'nice';
        }
    } catch (err) {
        outputs.msg = 'not nice' + err;
    }
    // ... code ...
})(inputs, outputs);

